export class Event {
    constructor(title, cal, startTime, endTime) {
        this.title = title;
        this.cal = cal;
        this.startTime = startTime;
        this.endTime = endTime;
        this.duration = (endTime - startTime) / 60000;
    }
    isAllDayEvent() {
        return duration == 1440;
    }
}
